description:
【ビジネスバッグ メンズ men's ブランド ショルダー ランキングbusinessbagmen's 革 軽量 出張 人気】
<br><br>
遂に完成！<br />
  なんでも詰め込めるスタイリッシュバッグ！ <br />
<br />

 書類やファイルなどスマートに収納できるビジネスバッグです。<br />
  メイン収納はジップ式になっており仕分けもしやすい作りです。<br />
  A4サイズが楽々入る広々としたスペースで、ノートPCも収納可能。<br />
<br />

 荷物が重たくなっても付属ショルダーベルトを使えば肩掛け鞄になります。<br />
  2wayで使え、あらゆる場面で活躍する事間違いなしです。<br />
<br />

 スタイリッシュなカラーデザインで、ビジネスバッグとしてだけでなく、<br />
  普段使いにもお勧めできる鞄となっています。 <br />

<br>
<br> 
素材 ： 合皮(PU)、ナイロン<br><br>
本体サイズ ： 約　W44.5×H30（持ち手含まず）×D8cm<br><br>
仕様 ： ・メイン収納（ファスナー） ・ポケット×２ ・ファスナーポケット×１ ・ショルダーストラップ付属<br>
<br>

※現物に近い色が出る様に写真を撮っておりますが、多少濃く見えたり、薄く見えたりする場合がございます。<br>
新品未使用品ですが、商品の性質や構造上により、どうしても小さい傷などが生じる場合が御座います。
<br><br>



